import { AnswerData } from "./questionsData";
import { Answer } from "./Answer";

interface Props {
    datas: AnswerData[];
}

export const AnswersList = ({ data }: Props) => {
    return (
        <ul>
            {data.map((answer) => (
                <li key={answer.Id}>
                    <Answer data={answer} />
                </li>
            ))}
        </ul>
    );
};
